import Task from './Task' 

const Tasks=({ tasks, ondeleteTask ,onToggel}) =>{

    return (
        <>
            {tasks.map((task) => 
            (<Task key={task.id} task={task} onDelete={ondeleteTask} onToggel={onToggel}/>))}   
        </>
    )
}

export default Tasks
